module.exports = "<h1 id=\"settings\">Settings</h1>\n<p>Here you are able to tweak a number of the settings for your interface - where it connects to, the actual theme and if you are a developer, have access to some additional features to allow for a stress-free connection to a (possibly) custom chain.</p>\n<h1 id=\"general\">General</h1>\n<p>In the general section you can setup the basic operation for your UI.</p>\n<ul>\n<li><strong>endpoint</strong> Defines the node to connect to. Select from one of the available hosted RPCs or connect to your own by specifying a custom URL. (Be aware that custom URLs should be behind secure WebSockets if you are using a UI hosted on a https endpoint)</li>\n<li><strong>theme</strong> Swap between a Polkadot or Substrate themed interface.</li>\n<li><strong>mode</strong> By default the UI appears in a fully-featured mode. You can select to only have the core features (which provides all the basics, unless you are a power user).</li>\n</ul>\n<h1 id=\"developer\">Developer</h1>\n<p>In this section, you are able to define custom types to be added to the underlying API. When developing a custom chain, it is typical that additional types are added. Defining them here allows the underlying API (and therefore the UI) have an understanding how to encode and decode these types.</p>\n<p>Types are saved across refreshes, so it is a single operation for all future usages of the UI. For the definitions, a simple JSON format is used, and example could be -</p>\n<pre><code>{\n  &quot;TransactionInput&quot;: {\n    &quot;parent_output&quot;: &quot;Hash&quot;,\n    &quot;signature&quot;: &quot;Signature&quot;\n  },\n  &quot;TransactionOutput&quot;: {\n    &quot;value&quot;: &quot;u128&quot;,\n    &quot;pubkey&quot;: &quot;Hash&quot;,\n    &quot;sale&quot;: &quot;u32&quot;\n  },\n  &quot;Transaction&quot;: {\n    &quot;inputs&quot;: &quot;Vec&lt;TransactionInput&gt;&quot;,\n    &quot;outputs&quot;: &quot;Vec&lt;TransactionOutput&gt;&quot;\n  }\n}</code></pre><p>Be aware that the types are registered in the order they appear here, however it does support resolution independent of the order. (Circular deps are not supported here). For a slightly more complex example, using both types, enums, tuples and Compact numbers, the following would be used -</p>\n<pre><code>{\n  &quot;ArrayThing&quot;: &quot;Vec&lt;Thing&gt;&quot;,\n  &quot;MyNumber&quot;: &quot;u32&quot;,\n  &quot;Thing&quot;: {\n    &quot;count_enum&quot;: &quot;SimpleEnum&quot;,\n    &quot;type_enum&quot;: &quot;TypeEnum&quot;,\n    &quot;counter&quot;: &quot;MyNumber&quot;,\n    &quot;tuple&quot;: &quot;(u32, u64)&quot;,\n    &quot;ids&quot;: &quot;Vec&lt;AccountId&gt;&quot;\n  },\n  &quot;SimpleEnum&quot;: {\n    &quot;_enum&quot;: [&quot;One&quot;, &quot;Two&quot;, &quot;Three&quot;]\n  },\n  &quot;TypeEnum&quot;: {\n    &quot;_enum&quot;: {\n      &quot;One&quot;: &quot;u32&quot;,\n      &quot;Two&quot;: &quot;Compact&lt;u64&gt;&quot;,\n      &quot;Three&quot;: null\n    }\n  }\n}</code></pre>";

